import React from 'react'
import WalletCard from './WalletCard'

function AssetList() {
  return (
    <div
      css={`
        display: flex;
        flex-direction: column;
      `}
    >
      <div
        css={`
          display: flex;
          flex-direction: row;
        `}
      >
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
      </div>
      <div
        css={`
          display: flex;
          flex-direction: row;
        `}
      >
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
      </div>
    </div>
  )
}

export default AssetList
